import React from 'react'
import '../App.css';

import ProfilePic from '../Assets/ProfilePic.jpg'

export default function AboutMe() {
    return (
        <div>
            <section id = "AboutMe">
            <div class ="image-cropper">
            <h1>About Me</h1>
            <p>Hello, my name is Tyler. I'm a full stack engineer with experience in React JS, SQL, and C#.

My dream is to start and manage a business of my own and to become a sucessful entrepreneur.

I am always teaching myself new things, currently I am working on a full stack banking application to gain more experience using SQL, C# .net core apis, and React Js.

This and the banking application are my lastest projects. You can check them out here or on the homepage of course.

When i'm not learning new skills chances are i'm reading about the lastest tech company developments, studing the stock market, working on my car or streaming on twitch.</p>

            <hr class="solid"/>
                <img 
                    alt="Profile" 
                    src = {ProfilePic} 
                    class ="profile-pic"
                    //style={{width: 280, height: 400, borderRadius: "50%", }} 
                />
            </div>
        </section>
        </div>
    )
}
